import React from 'react';
import { ListGroup,Button } from 'react-bootstrap';

export default function workers_management() {
  return (
  <div>
  <ListGroup as="ul" >
    <ListGroup.Item as="li"  ></ListGroup.Item>
    <Button variant="info">List Of Workers</Button>
    <Button variant="info">Add New Worker</Button>
  </ListGroup>
  </div>

  );
}
